  \"topographic-lidar-survey-of-the-chandeleur-islands-louisiana-february-6-2012-bare-earth-dems\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A topographic Lidar survey was conducted
  on February 6, 2012, over the Chandeleur Islands, Louisiana. The data were collected
  at a nominal pulse space of 0.5-meter (m) and processed to identify bare earth elevations.
  Bare earth digital elevation models (DEMs) were generated based on these data. Digital
  Aerial Solutions, LLC, was contracted by the U.S. Geological Survey (USGS) to collect
  and process the lidar data. The bare earth DEMs are 32-bit floating point ERDAS
  Imagine (IMG) files with a horizontal spatial resolution of 1-m by 1-m. They are
  in decimal degree geographic coordinates, North American Datum 1983, National Spatial
  Reference System 2007 (NAD83 NSRS2007)). Their vertical datum is North American
  Vertical Datum 1988, Geoid 2009, Geodetic Reference System 1980 (NAVD88 GEOID09
  GRS80) in meters. Thirty-three DEMs, based on a 2-kilometer (km) by 2-km tiling
  scheme, cover the entire survey area. These lidar data are available to Federal,
  State and local governments, emergency-response officials, resource managers, and
  the general public.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
